        for (let o of entities) {
            if (o.isPlayer || o.isBot) {
                if ([-1, -2, -3, -4, -5, -6, -7, -8].includes(o.team)) {
                    teams.find(entry => entry[0] === o.team)[1]++;
                    all++;
                };
            }
        }
        let team = teams.find(entry => entry[1] === all);
        if (team) winner(-team[0] - 1);
